import "../../../index.css";
export default function DoRegistration() {
    return (
        <div style={{ display: "flex",
        marginLeft: "312px", }}>
      
      <button style={{
        backgroundColor:"#3BAAB5",
        border:"0px",
        height:"15px",
        marginTop:"13px"
      }}></button>
      <text style={{
        fontWeight:"bold",
        marginTop:"10px",
        marginLeft:"10px"
      }}>수강신청 내역</text>

<div style={{
        display:"flex",
        flex:"start-reverse"
      }}>
        <text>123</text>
        
        <text>123</text>
        <text>123</text>
      </div>
</div>
      
    );
}
